import React from "react";
import Playstore from "../assets/playstore-icon-big.png"

const DropdownMenu = () => {
  return (
    <div className="dropdown-menu">
        <h4>Download From</h4>
        <img src={Playstore} alt=""/>
        <img src={Playstore} alt=""/>
        
    </div>
  );
};

export default DropdownMenu;
